  defaultValue: "Là nơi bắt đầu của những trải nghiệm tinh tế và khởi đầu cho mọi hoạt động kết nối cộng đồng. Tại đây, cư dân có thể thư giãn tại khu vực quầy bar, minibar, hoặc dạo bước qua khu trưng bày nghệ thuật trong một không gian sinh hoạt nhẹ nhàng, ấm cúng.",
