  defaultValue: "Tọa lạc trên rooftop với thiết kế mở và tầm nhìn thoáng đãng, đây là điểm hẹn lý tưởng cho những buổi gặp gỡ nhẹ nhàng hay những bữa tiệc nhỏ thân mật. Dưới ánh hoàng hôn rực rỡ, cư dân có thể nhâm nhi một tách cafe hay ly vang thượng hạng, tận hưởng sự tĩnh lặng và riêng tư sau một ngày dài.",
