  defaultValue: "Không gian vui chơi trong nhà được đầu tư kỹ lưỡng, đề cao sự an toàn và tính giáo dục. Với các trò chơi vận động và sáng tạo, nơi đây không chỉ giúp trẻ phát triển thể chất mà còn kích thích trí thông minh, mang đến cho những cư dân nhí một tuổi thơ đầy màu sắc và niềm vui.",
