  defaultValue: "Khu hồ bơi được tạo tác tỉ mỉ từ thiết kế đến công năng, mang đến một thiên đường thư giãn đúng nghĩa để vỗ về cơ thể và tinh thần sau ngày dài. Điểm nhấn đắt giá là thác nước kết hợp hệ thống sợi quang ánh sáng, biến không gian mặt nước thành một vương quốc ánh sáng lung linh, huyền ảo mỗi khi đêm về.",
