  defaultValue: "Sở hữu số lượng giới hạn chỉ 31 căn, mỗi không gian tại đây được lấy cảm hứng từ phong cách The Great Gatsby - biểu tượng của sự quyến rũ và tinh thần Art Deco kinh điển. Dự án mang đến những không gian trình diễn đậm chất nghệ thuật với mặt tiền đại lộ nổi bật. Nhờ khả năng khai thác linh hoạt cho các lĩnh vực F&B, bán lẻ và nhiều dịch vụ hiện đại khác, nơi đây hứa hẹn trở thành tâm điểm giao thương năng động, nơi mỗi thương hiệu đều có cơ hội tỏa sáng giữa nhịp sống không ngừng của Nam Sài Gòn.",
